const TodoForm = () => {
    const [value, setValue] = useState();

    const handleChange = (e) => {
        setValue(e.target.value)

    }
    return (
        <>
            <form >
                <input type="text"  value={value} onChange={handleChange}/>
                <button>add</button>
                <button>delete</button>
            </form>

        </>
    );
};

export default TodoForm;
